import React from "react";
import "./../styles/Footer.css";

function Footer() {
  return (
    <footer className="footer">
      <p>16499 경기도 수원시 영통구 월드컵로 206 제2학생회관(신학생회관) 209호 아주대학교 영자신문사 The Ajou Globe</p>
      <p>Editor-in-Chief Kim Ji-yeon  jykim0502@ajou.ac.kr</p>
      <p>Illustration Designer Kim Da-hye disney4195@ajou.ac.kr</p>
      <p> </p>
      <p>Website Developer Noh Hyun-jin noh0605@ajou.ac.kr</p>
      <p>COPYRIGHT ⓒ 2024 The Ajou Globe. ALL RIGHTS RESERVED. </p>
    </footer>
  );
}

export default Footer;
